script: |
  super -f text -I q9035.spq | sort > q9035.out

inputs:
  - name: q9035.spq
    data: |
      SELECT - 76 * col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( - ( col0 ) * 49 * 9 - + col2 + + ( - col2 ) ) BETWEEN - 40 + - + 38 AND NULL;
  - name: tab1

outputs:
  - name: q9035.out
    data: |
      -4484
      -5168
      -7296
